sys_variable_value.value:
(function execute(inputs, outputs) {
	var stageProjectURL = inputs.StageProjectURL;
    outputs.stageprojectid = stageProjectURL.substring(stageProjectURL.lastIndexOf("/")+1);
})(inputs, outputs);

